window.bookSummaryJSON = "<p>Snow Falls, Montana.</p> <p>I’ve found myself in a town full of shifters. Shifters I never wanted to be around ever again. My blood sings being surrounded by my own kind.</p> <p>But they aren’t my kind.</p> <p>I’m a half breed who can’t shift.</p> <p>Useless.</p> <p>But I’ve proved everyone wrong. I’ll show them all I’m more than an abomination.</p> <p>Yet, a snarky Wolf and sexy as sin twin leopards insist I’m their mate.</p> <p>And they won’t let me go.</p> <p>Leopards, wolves, and Fae oh my.</p> <p>Hell has come to Snow Falls and we must fight as one or be destroyed.</p> <p>Will they take my heart by storm or will my doubts get the best of me?</p>"; 
